    func test1() throws {
        let m64 = MT64(seed: UInt64(0))
        for i in 0 ..< randomUInt1.count {
            XCTAssertEqual(randomUInt1[i], m64.nextUInt64())
        }
        for i in 0 ..< randomDouble1.count {
            XCTAssertEqual(Double(bitPattern: randomDouble1[i]), m64.nextDouble(open: true))
        }
    }

    func test2() throws {
        let m64 = MT64(seed: [UInt64(0x12345), 0x23456, 0x34567, 0x45678])
        for i in 0 ..< randomUInt2.count {
            XCTAssertEqual(randomUInt2[i], m64.nextUInt64())
        }
        for i in 0 ..< randomDouble2.count {
            XCTAssertEqual(Double(bitPattern: randomDouble2[i]), m64.nextDouble(open: true))
        }
    }
    
    func test32() throws {
        let mt64 = MT64()
        let state = mt64.getState()
        let x64 = mt64.nextUInt64()
        mt64.setState(state: state)
        let x32x2 = UInt64(mt64.nextUInt32()) | (UInt64(mt64.nextUInt32()) << 32)
        XCTAssertEqual(x64, x32x2)
    }
    
    func testCopy() throws {
        let mt64 = MT64()
        let mtx = MT64(mt: mt64)
        XCTAssertEqual(mt64, mtx)
        XCTAssertEqual(mt64.nextDouble(), mtx.nextDouble())
    }

